import React from 'react';
import './WorkArea.css';

function WorkArea() {
    // series of tabs with different editors monaco representing different file types
    return (
        <div className="work-area">
            <div className="tab">
                <div className="tab-title">File 1</div>
                <div className="tab-content">
                    <div className="editor">Editor 1</div>
                </div>
            </div>
            <div className="tab">
                <div className="tab-title">File 2</div>
                <div className="tab-content">
                    <div className="editor">Editor 2</div>
                </div>
            </div>
            <div className="tab">
                <div className="tab-title">File 3</div>
                <div className="tab-content">
                    <div className="editor">Editor 3</div>
                </div>
            </div>
        </div>
    );
    
}

export default WorkArea;
